import React from 'react';
import { Provider } from 'react-redux';
import { LocaleProvider } from 'antd';
import { Router } from 'react-router-dom';
import { utils } from 'demo-common';
import zhCN from 'antd/es/locale-provider/zh_CN';

const Wrapper = ({ children }) => (
  <LocaleProvider locale={zhCN}>
    <Provider store={utils.stateContainer._store}>
      <Router history={utils.stateContainer._history}>{children}</Router>
    </Provider>
  </LocaleProvider>
);

export default Wrapper;
try {
    // @ts-ignore
    wrapper.displayName = "wrapper";
    // @ts-ignore
    wrapper.__docgenInfo = { "description": "", "displayName": "wrapper", "props": {} };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/wrapper.tsx#wrapper"] = { docgenInfo: wrapper.__docgenInfo, name: "wrapper", path: "src/wrapper.tsx#wrapper" };
}
catch (__react_docgen_typescript_loader_error) { }
